import React from 'react'
import { auth } from '../../firebase';
const Rooms = () => {
    const logout = () => {
        auth.signOut();
    }
    return (
        <div>
            Room Section
            <button style={{ "marginLeft": "20px" }} onClick={logout}>Logout</button>
        </div>
    )
}

export default Rooms
